import React from "react";
import {Link} from 'react-router-dom';
import Header from "../partials/Header";
import "./Assests/css/Home.css";

export default function DHome() {


    const getNotify = async()=>{

      let result = await fetch("http://localhost:5000/getNotifications", {
      method: "post",
      body: JSON.stringify({}),
      headers: {
        "Content-Type": "application/json",
      }, 
    })
    .then((response) => response.json())
      .then((data) => {
        setStatus(data.status);
      })
      .catch((error) => {
        console.error('Error submitting form:', error);
      });

    };





  return (
    <>
      <Header />
      <h1 className="welcome">Welcome Doctor</h1>
      <button
        class="btn btn-primary"
        type="button"
        onClick={getNotify}
        data-bs-toggle="offcanvas"
        data-bs-target="#offcanvasScrolling"
        aria-controls="offcanvasScrolling"
      >
        Notifications
        <span class="badge text-bg-dark rounded-pill">14</span>
      </button>

      <div
        class="offcanvas offcanvas-start"
        data-bs-scroll="true"
        data-bs-backdrop="false"
        tabindex="-1"
        id="offcanvasScrolling"
        aria-labelledby="offcanvasScrollingLabel"
      >
        <div class="offcanvas-header">
          <h5 class="offcanvas-title" id="offcanvasScrollingLabel">
            Notifications
          </h5>
          <button
            type="button"
            class="btn-close"
            data-bs-dismiss="offcanvas"
            aria-label="Close"
          ></button>
        </div>
        <div class="offcanvas-body">
          <ul class="list-group">

            <li class="list-group-item">
                <div class="notificationBox">
                    <h5><Link className="requestdetailslink" to="/requestdetails">hospital</Link></h5>
                    <p>Ex. Date: 12-23-2004</p>
                </div>
            </li>
          </ul>
        </div>
      </div>
    </>
  );
}
